import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Navbar.css';
import homeIcon from '../assets/lightsaber 2.png';
import planetsIcon from '../assets/galaxy 2.png';
import charactersIcon from '../assets/droid 2.png';
import starshipsIcon from '../assets/aircraft 2.png';
import logo from '../assets/log';

const Navbar = () => {
  const location = useLocation();

  return (
    <nav className="navbar">
      <ul className="navbar-menu">
        <li>
          <Link to="/">
            <img src={homeIcon} alt="Home" className="menu-icon" />
            Home
          </Link>
        </li>
        <li>
          <Link to="/planets">
            <img src={planetsIcon} alt="Planets" className="menu-icon" />
            Planets
          </Link>
        </li>
        <li>
          <Link to="/characters">
            <img src={charactersIcon} alt="Characters" className="menu-icon" />
            Characters
          </Link>
        </li>
        <li>
          <Link to="/starships">
            <img src={starshipsIcon} alt="Starships" className="menu-icon" />
            Starships
          </Link>
        </li>
        {/* <Button color="inherit" component={Link} to="/favorites">Favorites</Button> */}
      </ul>
      {location.pathname === '/' && (
        <p className="navbar-text">Hello, it is Star Wars</p>
      )}
    </nav>
  );
};

export default Navbar;
